font-size: 16px;
color: white;





`;

export const NavBar = styled.nav`
padding: 20px;
height: 2vh;
display:flex;
width:100%;


`;

export const Name = styled.div`
    color:black;
    font-size: 1rem;
`;

export const Name2 = styled.div`
    color:#6C6C71;
    font-size: 2rem;
`;



